AA_NAMES = [
    "GLY", "ALA", "SER", "CYS", "VAL", "THR", "ILE", "PRO", "MET", "ASP",
    "ASN", "LEU", "LYS", "GLU", "GLN", "ARG", "HIS", "PHE", "TYR", "TRP",
    "UNK"
]

SHORT_AA_NAMES = "GASCVTIPMDNLKEQRHFYWX"

# Create a mapping from 3-letter code to 1-letter code
AA_MAP_3_TO_1 = {name: SHORT_AA_NAMES[i] for i, name in enumerate(AA_NAMES)}
# Add non-canonical mappings from the C code's setseq function
AA_MAP_3_TO_1.update({
    "GLX": "E",
    "ASX": "D",
    "HID": "H",
    "MSE": "M",
    "SEP": "S",
    "TPO": "T",
    "PTR": "Y",
})

# Mapping from 1-letter code to an integer index
AA_NUMS = {code: i for i, code in enumerate(SHORT_AA_NAMES)}
AA_NUMS['X'] = 20 # UNK

# Mapping from 3-letter code to integer index
AA_MAP_3_TO_NUM = {
    three: AA_NUMS[one] for three, one in AA_MAP_3_TO_1.items()
}

